{-# LANGUAGE OverloadedStrings #-}

module GamesParser (
  paresGamesList
) where

import Api
import Game

import Control.Applicative
import Data.Attoparsec.ByteString.Char8
import qualified Data.ByteString.Char8 as BS


paresGamesList :: Parser [Game]
paresGamesList = manyTill gameP lastLine where
  lastLine = do
    option "" "\n"
    many' space
    count <- decimal
    space
    "games displayed.\n"


gameP :: Parser Game
gameP = do
  option "" "\n"
  many space
  id <- decimal
  many1 space
  exampleGame <- option False (string "(Exam." *> pure True)
  setupGame <- option False (string "(Setup" *> pure True)
  many' space
  p1Rating <- parseRating
  many1 space
  p1Name <- manyTill anyChar space
  many' space
  p2Rating <- parseRating
  many1 space
  p2Name <- manyTill anyChar (space <|> char ')')
  many' space
  option "" ")"
  many' space
  settings <- settings'
  manyTill anyChar "\n"
  return $ Game id exampleGame p1Rating p1Name p2Rating p2Name settings


settings' :: Parser GameSettings
settings' = do
  "["
  ip <- isPrivate'
  gt <- anyChar -- gameType'
  ir <- isRated'
  manyTill anyChar "]"
  return $ GameSettings ip Standard ir



parseRating :: Parser Rating
parseRating =
  (decimal >>= \r -> return $ Rating r) <|>
  string "++++" *> pure Guest <|>
  string "----" *> pure Unrated


gameType' :: Parser GameType
gameType' =
  (char 'b' *> pure Blitz) <|>
  (char 'l' *> pure Lightning) <|>
  (char 'u' *> pure Untimed) <|>
  (char 'e' *> pure ExaminedGame) <|>
  (char 's' *> pure Standard) <|>
  (char 'w' *> pure Wild) <|>
  (char 'x' *> pure Atomic) <|>
  (char 'z' *> pure Crazyhouse) <|>
  (char 'B' *> pure Bughouse) <|>
  (char 'L' *> pure Losers) <|>
  (char 'S' *> pure Suicide) <|>
  (char 'n' *> pure NonStandardGame)


isPrivate' :: Parser Bool
isPrivate' = space *> pure False <|> char 'p' *> pure True


isRated' :: Parser Bool
isRated' = char 'u' *> pure False <|> char 'r' *> pure True

